import React from 'react';
import './App.css';
import { Switch, Route, BrowserRouter as Router } from "react-router-dom";
import Login from "./containers/login/Login"
import UsersList from "./containers/user/UsersList"

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/users">
            <UsersList />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
